//App.js
import React from 'react';



function App() {
    return (
    <div className="section has-text-centered">
      <h1 className="title has-text-white">Applied Jobs</h1>
      <button
        className="button is-danger"
        onClick={() => (window.location.href = '/logout')}
      >
        Logout
      </button>
    </div>
  );
}

export default App;
